#   Three different functions for ordering lists ordered from smallest to largest

# 10000 elements in 4,458s
def intertionSort(list):
    n = len(list)
    for i in range(len(list)):
        j = i
        while j > 0 and list[j-1] > list[j]:
            temp = list[j]
            list[j] = list[j-1]
            list[j-1] = temp
            j -= 1
    return list

# 10000 elements in 5,764s
def bubbleSort(list):
    n = len(list)
    for i in range(n-1):
        for j in range(n-i-1):
            if list[j] > list[j+1]:
                temp = list[j]
                list[j] = list[j+1]
                list[j+1] = temp
    return list
# 10000 elements in 2,520
def selectionSort(list):
    n = len(list)
    for i in range(n):
        min = i
        for j in range(i+1, n):
            if list[j] < list[min]:
                min = j
        temp = list[min]
        list[min] = list[j]
        list[j] = temp
    return list

import random
def generateRandomList():
    list = []
    for i in range(10000):
        list.append(random.randint(0, 10000))
    return list

